// headder designe
import classes from "./Headder.module.css";
function Headder() {
  return (
    <header>
      <div className={classes.roundlogo}>
        <img src="../rec/logoround.jpg" />
      </div>
      <div className={classes.logoHolder}>
        <div className={classes.gec}>guntur engineering college</div>
        <div className={classes.kits}>is now managed by kits</div>
      </div>
    </header>
  );
}
export default Headder;
